;; <=

;; @@
(def total (sel data :cols 11))
(def azero (count (filterv #(= % 0) total)))

(def acomplete (count (filterv #(= % 100) total))) 
                  
(def aprogress(count (filterv (apply every-pred [#(< % 100) #(> % 0)]) total)))
;(def aprogress (count (for [x total :when (and (< x 100) (> x 0))] x))) 

(print 
  " Complete: " acomplete ",  %" (*(/ acomplete (count total))100.0)\newline
 
  "Didn't start: " azero ",  %" (*(/ azero (count total))100.0)\newline
 
  "In Progress:  " aprogress ",  %" (round (*(/ aprogress (count total))100.0)))
                                     
